import React from 'react';
import styled from 'styled-components/native';

import { TouchableOpacity, StyleSheet, Image, View , Text} from 'react-native';
import { Feather } from '@expo/vector-icons';

import Photo1 from '../assets/baby1.jpg'

const ExploreArticle = () => {

    return (
        <>
            <Main>

                <View style={styles.overlayContainer}>
                    <View style={styles.overlay}>
                        <TouchableOpacity onPress={() => navigation.navigate('ExploreArticle')}>
                            <Image source={Photo1} style={styles.photo} />
                        </TouchableOpacity>
                        <Feather name="arrow-left" size={24} color="black" />
                        <Text style={styles.overlayText}> Svårt att sitta själv?  </Text>

                    </View>

                    </View>

            </Main>

        </>
    )
}

const styles = StyleSheet.create({
        photo: {
        height: 300,
        width: 375,
        shadowColor: '#202020',
        shadowOffset: { width: 0, height: 2 },
        shadowRadius: 2,
        borderRadius: 20,
    },
    overlayContainer: {
        flexDirection: 'row',
    },
    overlay: {
        borderRadius: 20,
        backgroundColor: '#94A968',
        marginLeft: 6,
        marginRight: 6,
    },
    overlayText: {
        position:'absolute',
        fontSize: 10,
        color: 'white',
        paddingTop: 7,
        paddingBottom: 7,
    }
})

const Main = styled.View`
flex: 1;
background-color:#5A673E;
border: solid 2px white;
`


export default ExploreArticle;
